import { useSwiper, Swiper, SwiperSlide } from "swiper/react";

// Import Swiper styles
import "swiper/css";
import "swiper/css/pagination";
import "./Main.css";
import Intro from "./Intro.js";
import Upload from "./Upload.js";

// import required modules
import SwiperCore, { Pagination, Mousewheel, Navigation } from "swiper";

SwiperCore.use([Mousewheel, Pagination, Navigation]);

const Main = () => {

  const swiper = useSwiper();

    return (
    <div class = "Main">
    <Swiper
      direction={"vertical"}
      speed={800}
      modules={[Pagination]}
      mousewheel
      autoplay={false}
      pagination={{
        clickable: true
      }}
      className="mySwiper"
  
    >
      <SwiperSlide>
        <div class = "start">
            <div id = "sentence"> Animal Behavior </div>
            <div> Briefly Analyze in <strong> B-fact </strong></div>
            <div class = "start_button">
              <button onClick={() => swiper.slideNext()} tabIndex={-1}> I'm a Newbie </button>
              <button onClick={() => swiper.slideTo(3)} tabIndex={-1}> Already Got it </button>
            </div>  
        </div>
      </SwiperSlide>
      <SwiperSlide><Intro /></SwiperSlide>
      <SwiperSlide><Upload /></SwiperSlide>
      <SwiperSlide>Result</SwiperSlide>
    </Swiper>
    </div>
  );
}

export default Main;
